E_D("replace into `phome_enewstags` values('133','罪案现场','zuianxianchang','3','0','0','在罪案现场能发生什么了什么事情？谁被谋害了？杀手又是谁？一切都需要你来找到答案，玩到这一类的游戏时，你一定要睁大眼睛找出画面中隐藏的线索啊！3366罪案现场的游戏合集里有太多这样的元素，来试试你的胆量吧！','/d/img/tag/133_80.jpg','/d/img/tag/133_200.jpg','http://www.3366.com/heji/90_new.shtml','0');");
E_D("replace into `phome_enewstags` values('134','暴力血腥','baolixuexing','5','0','0','暴力血腥的小游戏，玩这一类的游戏的时候，大家可以当做发泄，不要当真哦！不过，这一类的游戏貌似特别受欢迎，玩的时候会有很爽的感觉吧！赶紧来尝试一下3366小编的眼光吧！','/d/img/tag/134_80.jpg','/d/img/tag/134_200.jpg','http://www.3366.com/heji/128_new.shtml','0');");
