E_D("replace into `phome_enewstags` values('137','学生','xuesheng','89','0','0','下课铃响了，终于放学了！结束了一天的学习生活，除了完成功课，继续投入新的课外活动之外，还有没有什么时间是属于娱乐的？3366贴心地准备了很多款适合各位同学玩的小游戏，为你忙碌的学习生活增添一些娱乐的元素。','/d/img/tag/137_80.jpg','/d/img/tag/137_200.jpg','http://www.3366.com/heji/40_new.shtml','0');");
E_D("replace into `phome_enewstags` values('138','方块','fangkuai','7','0','0','6个面，8个点，12条线组成一个规规矩矩的方块；但是，多个方块聚集在一起，可以衍生出无穷无尽的玩法！俄罗斯方块，方块迷阵，智力方块，拼图方块，撞球方块，玛丽方块，索尼克方块……你准备好了么？','/d/img/tag/138_80.jpg','/d/img/tag/138_200.jpg','http://www.3366.com/heji/45_new.shtml','0');");
E_D("replace into `phome_enewstags` values('139','消除','xiaochu','16','0','0','喜欢玩消除小游戏吗？不妨来试试3366的消除合集吧，在这个合集里，你会看到各种各样的方块消除、小球消除、颜色消除等小游戏，你一定能找到喜欢的消除游戏，一次性把连连看、对对碰和消消看游戏彻底玩个够吧！记得把喜欢的分享给好友哦！','/d/img/tag/139_80.jpg','/d/img/tag/139_200.jpg','http://www.3366.com/heji/108_new.shtml','0');");
