E_D("replace into `phome_enewstags` values('141','小动物','xiaodongwu','37','0','0','在小游戏的世界里，小动物总是扮演着很多重要的角色，小狗有时是游戏主人公，小猫有时是游戏里的敌人和坏蛋，可是，不管在什么游戏里，这些小动物看起来似乎都挺可爱的，至少，在3366的小动物合集里，你看到的小动物都是很可爱的哟。','/d/img/tag/141_80.jpg','/d/img/tag/141_200.jpg','http://www.3366.com/heji/87_new.shtml','0');");
E_D("replace into `phome_enewstags` values('142','可爱','keai','48','0','0','可爱的小游戏总是会让人发自内心的喜欢。小编喜欢画风很可爱的小游戏，玩起来手感也会因为画面的可爱而变好。来吧，3366为您准备了众多可爱的小游戏，手指一动，就能体验啦！','/d/img/tag/142_80.jpg','/d/img/tag/142_200.jpg','http://www.3366.com/heji/126_new.shtml','0');");
E_D("replace into `phome_enewstags` values('143','养成','yangcheng','1','0','0','通过我们爱心培育，使游戏中的小动物，或人按照我们想他发展的方向成长。在这里你能体会到当一个充满爱心的哺育者的角色，你会体验到父母养育子女的不辛酸。在3366你能领略到更多的温情，让我们的爱在3366中绽放吧。','/d/img/tag/143_80.jpg','/d/img/tag/143_200.jpg','http://www.3366.com/heji/226_new.shtml','0');");
