E_D("replace into `phome_enewstags` values('145','中文汉化','zhongwenhanhua','44','1','0','外文游戏看不懂？没关系，中文游戏也一样的好玩！完全中文游戏，专为国人设计，让你更好的享受游戏的快乐。3366中文游戏专题收录国内外中文类小游戏，专为看不懂外文的你准备！不要因为语言而减少游戏的乐趣！','/d/img/tag/145_80.jpg','/d/img/tag/145_200.jpg','http://www.3366.com/heji/69_new.shtml','0');");
E_D("replace into `phome_enewstags` values('146','躲避','duobi','5','1','0','躲避类游戏的精髓就在于，一定要竭力避开你所遇到的一切阻碍，不然，很容易挂掉的哦！在这一个合集里，你只要帮助游戏的主人公避开那些危险就够了！来吧，要相信自己可以行的！','/d/img/tag/146_80.jpg','/d/img/tag/146_200.jpg','http://www.3366.com/heji/116_new.shtml','0');");
E_D("replace into `phome_enewstags` values('147','创意','chuangyi','48','1','0','创意应该都是以想法动人，好的创意会让大家都感到喜爱，不好的创意也会让人感到郁闷。我们不时会想，小游戏的创意体现在什么地方呢？总而言之，凡是以前没玩过的、玩起来感觉很新颖的，激发玩家思考的游戏，都算是有创意的小游戏。如果你没有试过，那快来3366的创意合集中尝试一下吧！','/d/img/tag/147_80.jpg','/d/img/tag/147_200.jpg','http://www.3366.com/heji/123_new.shtml','0');");
E_D("replace into `phome_enewstags` values('148','原创','yuanchuang','29','0','0','3366引进了大量的原创小游戏哦！这些小游戏都很贴近我们平时的日常生活，而且操作方式也很简单，小编极力推荐哦！如果不知道选择什么游戏，可以来这里淘淘宝，看看能不能找到你喜欢的那一类小游戏吧！','/d/img/tag/148_80.jpg','/d/img/tag/148_200.jpg','http://www.3366.com/heji/130_new.shtml','0');");
E_D("replace into `phome_enewstags` values('149','怪物','guaiwu','28','0','0','怪物在小游戏中一直都扮演着非常可怕的角色，它们通常都是反面的，会对我们的主角产生威胁，3366为您收录了大量的与打怪有关的小游戏，在这里，你可以看到各种可恶的、可爱的怪物。','/d/img/tag/149_80.jpg','/d/img/tag/149_200.jpg','http://www.3366.com/heji/86_new.shtml','0');");
E_D("replace into `phome_enewstags` values('150','奥特曼','aoteman','4','0','0','有人说幸福很简单，就像奥特曼打小怪兽。对于这一群来自宇宙的奇迹战士，最简单而又最平凡的幸福就是消灭入侵者，维护地球的和平。3366奥特曼专题收录国内外奥特曼类小游戏，让你在游戏中越玩越开心，体会到最简单的幸福！','/d/img/tag/150_80.jpg','/d/img/tag/150_200.jpg','http://www.3366.com/heji/31_new.shtml','0');");
E_D("replace into `phome_enewstags` values('151','僵尸','jiangshi','18','0','0','《生化危机》游戏自从1996年3月22日登陆PS平台以来，开创了生存恐怖游戏的新纪元。另有同名电影，书籍，乐队等，成为开发商日本卡普空（CAPCOM）历史上销量最高的游戏。本专题收集了具有恐怖和冒险两大元素的系列Flash游戏，让你体会生化危机的精髓。','/d/img/tag/151_80.jpg','/d/img/tag/151_200.jpg','http://www.3366.com/heji/48_new.shtml','0');");
E_D("replace into `phome_enewstags` values('152','白领','bailing','95','0','0','做一个每天上班忙碌的小白领真的不容易啊！碰到休闲时光就要好好利用啊！否则，每天都累死累活的多不舒服！3366这边可是专门为白领准备了很多类型的游戏，不妨来尝试一下？','/d/img/tag/152_80.jpg','/d/img/tag/152_200.jpg','http://www.3366.com/heji/39_new.shtml','0');");
E_D("replace into `phome_enewstags` values('153','机器人','jiqiren','8','0','0','看过《机器人瓦力》之后就很喜欢机器人了，不过，不知道关于机器人的小游戏时什么样子的呢？要怎么玩呢？别着急，可以来3366解开你的谜团！来吧，尽情的挖掘属于你的机器人吧！','/d/img/tag/153_80.jpg','/d/img/tag/153_200.jpg','http://www.3366.com/heji/85_new.shtml','0');");
E_D("replace into `phome_enewstags` values('154','轻松','qingsong','89','0','0','很多人玩游戏的目的就是为了解闷、打发时间什么的，所以，轻松的游戏是很多人会率先选择的一类游戏。不过，轻松的游戏具体指什么呢？小编觉得，画面可爱，游戏操作简便，不那么复杂的就算轻松的。如果觉得找轻松的游戏比较麻烦，不妨来这里找吧。','/d/img/tag/154_80.jpg','/d/img/tag/154_200.jpg','http://www.3366.com/heji/122_new.shtml','0');");
