E_D("replace into `phome_enewstags` values('156','情侣','qinglv','14','0','0','月上柳梢头，人约黄昏后。在你我的豆蔻年华里，少男少女们演绎了一场场凄美动人的美妙爱情故事，也留下了珍珠一样一串串的美丽回忆。3366恋爱约会专题收录国内外恋爱约会类小游戏，让一个个美好的故事在你手中诞生吧！','/d/img/tag/156_80.jpg','/d/img/tag/156_200.jpg','http://www.3366.com/heji/54_new.shtml','0');");
E_D("replace into `phome_enewstags` values('157','飞行滑翔','feixinghuaxiang','2','1','0','人类一直有征服天空的梦想，正因为有了对梦想不断的追求，才有了今天的飞天工具。而人类最初翱翔于天空，靠的正是滑翔的技术，现在滑翔已经成为了一种娱乐活动，要不要来试试？3366飞行滑翔专题收录国内外飞行滑翔类小游戏，让你体验征服天空的感觉！','/d/img/tag/157_80.jpg','/d/img/tag/157_200.jpg','http://www.3366.com/heji/62_new.shtml','0');");
E_D("replace into `phome_enewstags` values('158','升级成长','shengjichengchang','4','1','0','在养成游戏里，升级成长是十分常见的一类游戏，喜欢玩这类游戏的朋友们可能十分清楚，养成游戏可是很折腾人的呢，一子下错，可能满盘皆输呢！来3366体验升级成长的乐趣吧！','/d/img/tag/158_80.jpg','/d/img/tag/158_200.jpg','http://www.3366.com/heji/113_new.shtml','0');");
