E_D("replace into `phome_enewstags` values('160','小球','xiaoqiu','9','1','0','大树下，田野里，甚至哪怕是建筑工地旁的一个小小空地，无论哪里都留下过我们玩弹珠的身影。小小的球，却可以承载大大的梦想，也承载了童年的欢乐，可现在，哪儿还能有玩弹珠的地方呢？3366弹球小球专题收录国内外弹球小球类小游戏，小球多玩法！','/d/img/tag/160_80.jpg','/d/img/tag/160_200.jpg','http://www.3366.com/heji/59_new.shtml','0');");
