E_D("replace into `phome_enewstags` values('171','钓鱼','diaoyu','3','0','0','钓鱼最大的乐趣和挑战就是耐心地等待，当你捕捉到鱼的那一刻，你会感觉极大的满足感和成就感。3366钓鱼小游戏合集，让你乘风破浪，在广阔的大海里捕捉各种奇怪的生物，赶紧来享受钓鱼的乐趣吧。','/d/img/tag/171_80.jpg','/d/img/tag/171_200.jpg','http://www.3366.com/heji/145_new.shtml','0');");
E_D("replace into `phome_enewstags` values('172','农场','nongchang','1','0','0','拥有一座农场可是一件非常幸福的事情，在你专属的农场里，你可以饲养任何你喜欢的动物，然后耐心的等待它们的成长！3366收集了大量与农场相关的可爱小游戏，喜欢的朋友可千万不要错过哦！','/d/img/tag/172_80.jpg','/d/img/tag/172_200.jpg','http://www.3366.com/heji/89_new.shtml','0');");
E_D("replace into `phome_enewstags` values('173','吃东西','chidongxi','5','0','0','美食我最喜欢，可是又要担心体重的问题，真烦人。在这里可不一样哦，海量美食，想吃就吃，不过可千万不要吃错了东西哟，看你能吃多少分！3366吃东西专题收录国内外吃东西类小游戏，让你毫无顾忌，尽情享用美食！','/d/img/tag/173_80.jpg','/d/img/tag/173_200.jpg','http://www.3366.com/heji/64_new.shtml','0');");
E_D("replace into `phome_enewstags` values('174','双人小游戏','shuangrenxiaoyouxi','26','0','0','我一个人不孤单，想一个人才孤单。为什么小游戏只能自己玩？拉上你的父母、好友、伴侣、同学，可以合作，可以竞技，一起来玩吧。好游戏，一起玩！3366双人小游戏专题收录国内外双人类小游戏，游戏虽好，也不要忽视身边的人哦，拉他们一起来！','/d/img/tag/174_80.jpg','/d/img/tag/174_200.jpg','http://www.3366.com/heji/60_new.shtml','0');");
E_D("replace into `phome_enewstags` values('175','必玩','biwan','52','0','0','必玩的游戏就是小编鼎力推荐的哦！在3366众多的小游戏中，小编最精心整理的合集就是必玩合集了！里面包含了众多经典给力的小游戏，都是可玩性很高的小游戏，不妨来试试？！','/d/img/tag/175_80.jpg','/d/img/tag/175_200.jpg','http://www.3366.com/heji/124_new.shtml','0');");
E_D("replace into `phome_enewstags` values('176','赛车竞速','saichejingsu','2','0','6',NULL,NULL,NULL,'http://www.3366.com/games/41-424_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('177','汽车','qiche','13','0','0','汽车是成功的标志，汽车是速度的象征。汽车不仅代表了一个时代的崛起，同时也方便了人类的交通运输。3366汽车合集，带你玩遍汽车游戏，跑车、小轿车、卡车、F1方程式，这里都有！喜欢车的朋友快来玩玩吧~！','/d/img/tag/177_80.jpg','/d/img/tag/177_200.jpg','http://www.3366.com/heji/95_new.shtml','0');");
E_D("replace into `phome_enewstags` values('178','驾驶技巧','jiashijiqiao','14','0','6',NULL,NULL,NULL,'http://www.3366.com/games/41-428_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('179','摩托车','motuoche','4','0','0','驰骋于黑色午夜，川流于繁华都市，只听见风在咆啸，只看见光在幻灭――这种快感，只有纵身驾驭风驰电掣的摩托车才能领略得到。3366摩托全系列收录国内外优秀摩托车小游戏，给你最简单的激情，最真实的速度！','/d/img/tag/179_80.jpg','/d/img/tag/179_200.jpg','http://www.3366.com/heji/47_new.shtml','0');");
E_D("replace into `phome_enewstags` values('180','海绵宝宝','haimianbaobao','5','0','0','新潮的你一定知道海绵宝宝是谁。没错，TA就是美国著名卡通影片《海绵宝宝》的主角“海绵宝宝”，哈哈o(∩_∩)o 以海绵宝宝为主角的Flash小游戏也已经大量开发出来，我们收集在3366小游戏门户中，让逐一尝个鲜。','/d/img/tag/180_80.jpg','/d/img/tag/180_200.jpg','http://www.3366.com/heji/32_new.shtml','0');");
E_D("replace into `phome_enewstags` values('181','外星飞船','waixingfeichuan','3','0','0','外星人的交通工具会是什么呢？如果他们真的能够在太空中飞翔，那他们的交通工具应该是飞船吧！坐在飞船上驰骋会是种怎样的感受呢？快来3366体验吧！','/d/img/tag/181_80.jpg','/d/img/tag/181_200.jpg','http://www.3366.com/heji/96_new.shtml','0');");
E_D("replace into `phome_enewstags` values('182','少年骇客','shaonianhaike','2','0','0','少年骇客是对付外星人的强大力量，他有着超强的天赋，只要指挥得当，他能很好的为拯救地球服务！所以，不要大意的，来3366帮助少年骇客打败外星变种敌人吧！要坚决的保卫地球哦！','/d/img/tag/182_80.jpg','/d/img/tag/182_200.jpg','http://www.3366.com/heji/77_new.shtml','0');");
E_D("replace into `phome_enewstags` values('183','超级玛丽','chaojimali','7','0','0','我就是那个风靡全球20多年的红帽子水管工马里奥，采蘑菇、踩怪物、打BOSS、救公主，这都是我的拿手好戏。快跟我和我的兄弟路易基一起来冒险吧，我们就是威震江湖的超级玛丽兄弟！3366超级玛丽专题收录国内外超级玛丽类小游戏，让你知道什么叫经典！','/d/img/tag/183_80.jpg','/d/img/tag/183_200.jpg','http://www.3366.com/heji/13_new.shtml','0');");
E_D("replace into `phome_enewstags` values('184','自行车','zixingche','1','1','0','世界上第一辆自行车面世至今已有500多年，可以说它极大改变了人们的生活方式，极大促进了世界发展。有人说有自行车的地方就有勤劳的中国人，此话不假。现在，3366把关于自行车的各种玩法搬到Flash小游戏中，相信你一定会喜欢的!','/d/img/tag/184_80.jpg','/d/img/tag/184_200.jpg','http://www.3366.com/heji/46_new.shtml','0');");
E_D("replace into `phome_enewstags` values('185','塔防TD','tafangTD','5','0','7',NULL,NULL,NULL,'http://www.3366.com/games/46-372_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('186','战士','zhanshi','8','1','0','哥是真英雄，铁血史泰龙。哥身手矫健，哥勇猛无敌。哥不在乎世人的眼光，不在乎别人怎么评价哥，只为了心中的理想。我就是这世上最后的真理和正义，永不倒下的铁血战士。3366铁血战士专题收录国内外战士类小游戏，让你感受真刀真枪的战斗！','/d/img/tag/186_80.jpg','/d/img/tag/186_200.jpg','http://www.3366.com/heji/43_new.shtml','0');");
E_D("replace into `phome_enewstags` values('187','防守','fangshou','10','0','7',NULL,NULL,NULL,'http://www.3366.com/games/46-374_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('188','两军对战','liangjunduizhan','3','0','7',NULL,NULL,NULL,'http://www.3366.com/games/46-373_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('189','变态版','biantaiban','5','1','0','变态版是指在原版的基础上对相关的小游戏做了一些数值上的修改，为了让体验更好，这种数值修改也是必要的。不知道你是否喜欢变态版的小游戏呢？不妨来尝试一下3366为你准备的变态版合集吧！','/d/img/tag/189_80.jpg','/d/img/tag/189_200.jpg','http://www.3366.com/heji/131_new.shtml','0');");
E_D("replace into `phome_enewstags` values('190','火柴人','huochairen','20','1','0','TA单腿修长，身材惹火，一点就着…TA是根火柴；TA会跑会跳，能歌善舞，怀着一颗正义的心，锄强扶弱，拳打天下…TA是我们的火柴人！这里有火柴人的最新最棒Flash游戏专辑，让你一次玩不够！','/d/img/tag/190_80.jpg','/d/img/tag/190_200.jpg','http://www.3366.com/heji/21_new.shtml','0');");
E_D("replace into `phome_enewstags` values('191','战争','zhanzheng','3','0','0','战争是一种集体和有组织的相互使用暴力的行为，也是自然界中弱肉强食的最极致的表现。在3366的游戏中，你能体现战争的硝烟弥漫，为了胜利尽情的杀戮吧！勇士们，拿起你手中的武器，一起来到3366的小游戏中，加入战团，缔造战无不胜的神话吧！','/d/img/tag/191_80.jpg','/d/img/tag/191_200.jpg','http://www.3366.com/heji/206_new.shtml','0');");
E_D("replace into `phome_enewstags` values('192','修改版','xiugaiban','9','0','0','修改版小游戏合集，包含了无敌版、关卡全开版、变态版。无敌版让你体验主控制无敌，拥有不死之身。关卡全开版让你可以直接开始末尾关卡。变态版增加了基本数值，让你玩游戏更加轻松。','/d/img/tag/192_80.jpg','/d/img/tag/192_200.jpg','http://www.3366.com/heji/237_new.shtml','0');");
E_D("replace into `phome_enewstags` values('193','战棋回合制','zhanqihuihezhi','2','0','7',NULL,NULL,NULL,'http://www.3366.com/games/46-379_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('194','海盗','haidao','4','0','0','有这么一群人，他们航行在无边无际大海之上，专门洗劫路过的商船，生死早就置之度外。海盗总是散发着他们独特的魅力，3366海盗小游戏合集有最齐全的海盗小游戏，让你过足海盗瘾，快来和海盗们一起征服大海吧。','/d/img/tag/194_80.jpg','/d/img/tag/194_200.jpg','http://www.3366.com/heji/227_new.shtml','0');");
E_D("replace into `phome_enewstags` values('195','无敌版','wudiban','9','0','0','无敌，我是否会寂寞？那些曾经困难的游戏，在我的面前都不值得一提。来吧，体验下蹂躏BOSS的快感，享受肆意虐怪的爽快吧。3366变态修改版专题收录国内外无敌或变态版小游戏，让你轻松体验那些看似困难的小游戏！','/d/img/tag/195_80.jpg','/d/img/tag/195_200.jpg','http://www.3366.com/heji/70_new.shtml','0');");
E_D("replace into `phome_enewstags` values('196','经典','jingdian','15','0','0','在你的印象中，经典游戏有哪些呢？小时候玩过的诸如超级玛丽、魂斗罗、冒险岛什么的，都算是经典游戏吧！到现在，你是否还记得那些经典游戏的玩法以及过关的秘诀呢？不用担心找不到这些记忆中的游戏，3366有很多哦！','/d/img/tag/196_80.jpg','/d/img/tag/196_200.jpg','http://www.3366.com/heji/120_new.shtml','0');");
E_D("replace into `phome_enewstags` values('197','坦克','tanke','3','0','0','你还记得当年跟邻居小朋友一起玩红白机的《坦克大战》，一起守卫鹰雕城堡的光辉岁月吗？让你重温光辉岁月，流连儿时记忆。我们准备了上百款坦克系列的Flash小游戏等你来玩，更多的武器，更多的装甲，更多的乐趣。','/d/img/tag/197_80.jpg','/d/img/tag/197_200.jpg','http://www.3366.com/heji/55_new.shtml','0');");
E_D("replace into `phome_enewstags` values('198','越野车','yueyeche','3','0','0','越野车一直深受大众的喜爱，尽管它从外观看起来并不如一些跑车那么拉风帅气，但事实上，这类车型还是广受追捧的！3366为您准备了众多与越野车相关的小游戏，都是速度与激情的挑战，赶紧来试试吧！','/d/img/tag/198_80.jpg','/d/img/tag/198_200.jpg','http://www.3366.com/heji/91_new.shtml','0');");
E_D("replace into `phome_enewstags` values('199','大卡车','dakache','2','0','0','驾驶的车辆越大，那种所向披靡的感觉就越强烈，3366大卡车小游戏满足你征服公路的欲望，让你驾驶各种给力的大卡车，将所有阻碍你前行的东西全部碾平，快来体验大卡车合集给你准备的畅快体验吧。','/d/img/tag/199_80.jpg','/d/img/tag/199_200.jpg','http://www.3366.com/heji/216_new.shtml','0');");
E_D("replace into `phome_enewstags` values('200','换装','huanzhuang','48','0','8',NULL,NULL,NULL,'http://www.3366.com/games/128-441_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('201','时尚','shishang','22','0','0','不要顾名思义的觉得时尚是女人的特权和所爱哦！其实很多男士也很热爱时尚的，那么，时尚究竟指什么呢？其实没有什么特定的指代，时尚可以指服装打扮，也可以指你的思想理念。不过，如果是小游戏，你猜时尚是什么定义呢？','/d/img/tag/201_80.jpg','/d/img/tag/201_200.jpg','http://www.3366.com/heji/125_new.shtml','0');");
E_D("replace into `phome_enewstags` values('202','婚纱','hunsha','3','0','0','婚纱是女孩子一生中最华丽、最漂亮的一套礼服，都说结婚的女人最美，那婚纱起的作用可是功不可没。3366婚纱小游戏合集有最漂亮的婚纱等你为新娘子穿上，请为她们装扮一个最抢眼的婚礼吧。','/d/img/tag/202_80.jpg','/d/img/tag/202_200.jpg','http://www.3366.com/heji/164_new.shtml','0');");
E_D("replace into `phome_enewstags` values('203','迪士尼','dishini','2','0','0','这里不仅有美丽善良的白雪公主，勇于追求幸福的小美人鱼，还有喜欢做梦的爱丽丝……不管你喜欢英俊勇敢的王子，或者逗人喜爱的小熊维尼，都欢迎你来到这次的迪士尼乐园！3366迪士尼专题收录国外各种迪士尼题材的小游戏，让你足不出户就能开始奇幻旅程！','/d/img/tag/203_80.jpg','/d/img/tag/203_200.jpg','http://www.3366.com/heji/36_new.shtml','0');");
E_D("replace into `phome_enewstags` values('204','明星','mingxing','4','0','0','喜欢哪位明星呢？喜欢歌星还是影星呢？在这个娱乐盛行的时代，娱乐圈的明星好像特别容易被追捧，更新换代也很快呢！来3366寻找你热爱的明星吧！','/d/img/tag/204_80.jpg','/d/img/tag/204_200.jpg','http://www.3366.com/heji/83_new.shtml','0');");
E_D("replace into `phome_enewstags` values('205','化妆','huazhuang','3','0','8',NULL,NULL,NULL,'http://www.3366.com/games/128-442_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('206','布置设计','buzhisheji','3','0','8',NULL,NULL,NULL,'http://www.3366.com/games/128-444_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('207','约会','yuehui','1','0','0','情侣间最常的活动可能就是约会了，约会的方式和地点都多种多样。但是都离开不开让情侣间更加亲密，爱意更浓。在这些充满了爱的游戏合集中，让我们一同感受3366所带给我们的亲密爱情吧。','/d/img/tag/207_80.jpg','/d/img/tag/207_200.jpg','http://www.3366.com/heji/205_new.shtml','0');");
E_D("replace into `phome_enewstags` values('208','魔法','mofa','4','0','0','阿拉丁神灯的三个愿望，青蛙变王子的童话，芝麻开门的密码……让你打开魔法之门，体验最神奇的魔力旅行，3366魔法小游戏专题，引领魔力来袭！','/d/img/tag/208_80.jpg','/d/img/tag/208_200.jpg','http://www.3366.com/heji/63_new.shtml','0');");
E_D("replace into `phome_enewstags` values('209','女巫','nvwu','1','0','0','女巫，来自人们幻想中的魔法世界。她们有着强大的魔力，经常带着顶黑黑的帽子，骑着扫把，给人一种非常神秘的感觉。在3366的游戏里，有着各种各样的女巫，一起来到3366这个充满魔法魅力的世界吧。','/d/img/tag/209_80.jpg','/d/img/tag/209_200.jpg','http://www.3366.com/heji/230_new.shtml','0');");
E_D("replace into `phome_enewstags` values('210','蛋糕','dangao','3','0','0','人们的惯性思维里，好像只是过生日的时候才能吃蛋糕，其实在外国，蛋糕是种很平常的食物，并不是只有在重大的日子里才能吃的哦！看3366为你准备了一些什么样的关于蛋糕的游戏吧！','/d/img/tag/210_80.jpg','/d/img/tag/210_200.jpg','http://www.3366.com/heji/97_new.shtml','0');");
E_D("replace into `phome_enewstags` values('211','公主','gongzhu','2','0','0','公主也算是西方的称谓，不过，在过去，那是一种对尊贵身份的称呼，而现在，很多女生都是公主哦！只要心地善良、热爱生活中的美好、积极阳光，你也是公主呢！来吧，3366为可爱的公主们准备了许多专属的小游戏，来尝试一下吧！','/d/img/tag/211_80.jpg','/d/img/tag/211_200.jpg','http://www.3366.com/heji/82_new.shtml','0');");
E_D("replace into `phome_enewstags` values('212','宝贝','baobei','6','0','0','哇！好可爱的宝贝啊~~无论是超萌的男宝宝，还是机灵的女宝宝，都那么惹人喜欢。喜欢和小宝宝们一起度过欢乐时光吗？3366将所有游戏中的可爱宝贝都汇聚在一起，快来照顾这帮可爱无辜的小家伙吧！','/d/img/tag/212_80.jpg','/d/img/tag/212_200.jpg','http://www.3366.com/heji/138_new.shtml','0');");
