E_D("replace into `phome_enewstags` values('214','海贼王','haizeiwang','1','0','0','神秘的海上生活总是让人向往，要跟着路飞一起做一个出色的敢作敢当的海贼吗？来加入这一个团队的，带着你的伙伴一起，勇敢的去冒险和突破吧！3366准备了众多的海贼王系列游戏，挑战你的胆量和勇气，快来吧！','/d/img/tag/214_80.jpg','/d/img/tag/214_200.jpg','http://www.3366.com/heji/76_new.shtml','0');");
