E_D("replace into `phome_enewstags` values('228','滑雪','huaxue','2','0','0','有一个非常刺激的体育运动只有在冬天皑皑白雪的时候才能体会，那就是滑雪。畅快的下滑，帅气的空中动作都是滑雪独一无二的魅力。3366滑雪小游戏合集，满足你对滑雪的渴望，无论你是南方人或者是在夏天，在3366，你都能体验到滑雪的乐趣。','/d/img/tag/228_80.jpg','/d/img/tag/228_200.jpg','http://www.3366.com/heji/163_new.shtml','0');");
