E_D("replace into `phome_enewstags` values('231','小狗','xiaogou','2','1','0','狗是人类最好的朋友，机灵可爱忠实憨厚的狗经常会惹得我们哈哈大笑。每一次飞奔，每一次警惕，都会让我们加深对狗狗的爱。3366小狗合集游戏，集合了国内外最有意思的狗狗游戏，让我们在游戏中和忠实的小狗再次亲密接触吧！','/d/img/tag/231_80.jpg','/d/img/tag/231_200.jpg','http://www.3366.com/heji/135_new.shtml','0');");
E_D("replace into `phome_enewstags` values('232','找东西','zhaodongxi','8','1','0','非常考验你眼力的时候到了，找东西小游戏大全里包含了太多关于找东西的小游戏，在这种时刻，你需要静下心来，虽然游戏玩法很简单，但还是要耐心啊！看看你能通关几个找东西的小游戏。','/d/img/tag/232_80.jpg','/d/img/tag/232_200.jpg','http://www.3366.com/heji/114_new.shtml','0');");
