E_D("replace into `phome_enewstags` values('234','打靶','daba','1','0','0','专业的射击运动必须配备的就是标靶。无论使用枪支，弓箭或者大炮，标靶都可以告诉你目前设计精准度如何。3366打靶小游戏合集，汇集多种打靶模式，移动打靶，武装打靶，一人多靶等，无论你喜欢什么挑战，3366小游戏都能满足你！快来试试吧。','/d/img/tag/234_80.jpg','/d/img/tag/234_200.jpg','http://www.3366.com/heji/150_new.shtml','0');");
