E_D("replace into `phome_enewstags` values('236','飞机','feiji','1','0','0','翱翔在蓝天一直是人类对自由的向往，而飞机实现了人类最大的心愿。3366飞机小游戏合集里面有各式各样的飞机让你操作，只要你不忘对天空的向往，那终有一天，你能像游戏里面一样驾驶各种飞机翱翔在美丽的蓝天中。','/d/img/tag/236_80.jpg','/d/img/tag/236_200.jpg','http://www.3366.com/heji/93_new.shtml','0');");
