E_D("replace into `phome_enewstags` values('238','忍者','renzhe','3','0','0','忍者（NINJA，にんじゃ）是日本自江户时代开始出现的一种特殊职业身份。忍者们接受忍术的训练，主要从事间谍活动。来玩3366忍者小游戏专题，体验日本江户时代的江湖风情。','/d/img/tag/238_80.jpg','/d/img/tag/238_200.jpg','http://www.3366.com/heji/41_new.shtml','0');");
E_D("replace into `phome_enewstags` values('239','一百层','yibaiceng','2','1','0','是上还是下？是一百层还是二百层？这都不重要，只要知道我们是在不断挑战极限就好了。但一定要记住，一旦一脚踏空，下面就是万丈深渊，只有脚踏实地，一步一个脚印才能走得更远。3366一百层专题收录国内外一百层类小游戏，让你尽情挑战自己。','/d/img/tag/239_80.jpg','/d/img/tag/239_200.jpg','http://www.3366.com/heji/61_new.shtml','0');");
