E_D("replace into `phome_enewstags` values('241','忍者神龟','renzheshengui','1','1','0','忍者神龟又出动了，这个城市里邪恶的鼠类真的很多，一直威胁着人们的安全，如何消灭这些鼠类，让它们尽快的见鬼去呢？这就是忍者神龟需要努力的方向了。作为忍者神龟的粉丝，3366的小编为您收集了众多与之相关的小游戏，来忍者神龟的世界拯救地球吧！','/d/img/tag/241_80.jpg','/d/img/tag/241_200.jpg','http://www.3366.com/heji/75_new.shtml','0');");
E_D("replace into `phome_enewstags` values('242','街机','jieji','1','1','0','一想起街机就会想起小时候那段时光，玩游戏的时候总是偷偷摸摸的，深怕老师和家长发现自己！现在，不知道这世界上还有没有街机的存在呢？3366有众多关于街机的游戏，赶紧来尝试吧！','/d/img/tag/242_80.jpg','/d/img/tag/242_200.jpg','http://www.3366.com/heji/111_new.shtml','0');");
E_D("replace into `phome_enewstags` values('243','黑白画面','heibaihuamian','3','1','0','很多人很喜欢黑白画面的游戏，因为画面颜色的简单不容易干扰玩家玩游戏的思路，就是抱着这种简单的思路，才能更好的游戏。3366有许多经典的黑白画面的游戏，就等你来挑战！','/d/img/tag/243_80.jpg','/d/img/tag/243_200.jpg','http://www.3366.com/heji/106_new.shtml','0');");
E_D("replace into `phome_enewstags` values('244','铠甲勇士','jiayongshi','2','1','0','《铠甲勇士》是我国拍摄的一部真人版特摄剧，描述的是金木水火土五侠的故事。上映以后，受到很多观众的喜爱，与此同时，与这部剧相关的游戏也非常多，而且也都非常好玩呢！来吧，让3366带您走进铠甲勇士的世界，一起消灭敌人，捍卫和平，感受胜利的喜悦吧！','/d/img/tag/244_80.jpg','/d/img/tag/244_200.jpg','http://www.3366.com/heji/23_new.shtml','0');");
E_D("replace into `phome_enewstags` values('245','蜡笔小新','labixiaoxin','2','1','0','他是小孩，可是他很“坏”；他很“坏”，可是他很可爱。你想扮演他纵横Flash小游戏世界么？现在动动鼠标玩玩3366蜡笔小新专题，完全满足你！','/d/img/tag/245_80.jpg','/d/img/tag/245_200.jpg','http://www.3366.com/heji/35_new.shtml','0');");
E_D("replace into `phome_enewstags` values('246','过河','guohe','1','0','0','过河游戏有两种模式，一种是需要你动脑思考的，船只承载的人数有限，并且互相之间有克制条件，需要你保全他们全部过到对岸。另一种需要挑战你的技术，面对漂浮的枯木要跳上去，在尽可能短的时间内到达对岸，并且不落入河里。无论你喜欢哪一种，3366过河小游戏合集都能让你找到喜欢的类型，好好地大玩特玩。','/d/img/tag/246_80.jpg','/d/img/tag/246_200.jpg','http://www.3366.com/heji/161_new.shtml','0');");
E_D("replace into `phome_enewstags` values('247','情人节','qingrenjie','1','0','0','情人节越来越流行了，国内的情侣们也都爱上了这个节日，关于这个节日的庆祝方式也越来越多。不过，其实单身的男女们都很害怕这个节日。不管你是否单身，在小游戏的世界里，你依然可以逍遥。来吧，3366精心为您准备了众多的小游戏，选择你所喜爱的，试试感觉吧。','/d/img/tag/247_80.jpg','/d/img/tag/247_200.jpg','http://www.3366.com/heji/119_new.shtml','0');");
E_D("replace into `phome_enewstags` values('248','电眼美女','dianyanmeinv','2','0','0','哇塞~！传说中的电眼美女来了，看她扭动身躯，一眼电晕任何学院帅哥，所有的师兄，各种学长们统统要拜倒在电眼美女的电流冲击中，无一例外！3366电眼美女小游戏合集，让你尝试万人迷的极大杀伤力。','/d/img/tag/248_80.jpg','/d/img/tag/248_200.jpg','http://www.3366.com/heji/146_new.shtml','0');");
