E_D("replace into `phome_enewstags` values('250','小猫','xiaomao','1','0','0','“喵~~”猫是最受宠的动物，因为猫会撒娇，会蹭脚，还会各种萌系动作，乐意的时候来个抓尾巴，不乐意的时候蜷成一团睡大觉。3366小猫合集，所有猫类萌系游戏等待你来发觉更多可爱。','/d/img/tag/250_80.jpg','/d/img/tag/250_200.jpg','http://www.3366.com/heji/134_new.shtml','0');");
