E_D("replace into `phome_enewstags` values('254','森林冰火人','senlinbinghuoren','1','1','0','森林冰火人是一款经典的益智类闯关小游戏，在游戏中，你要帮助森林中的水孩和火孩顺利过关，并收集所有的宝石。关卡有很多陷阱和谜题，需要两个孩子很好的配合，才可以过关！重要的是不论自己或2人玩都可以，非常有意思。3366森林冰火人小游戏合集，让你在森林冰火人的世界里拿宝石闯天关！','/d/img/tag/254_80.jpg','/d/img/tag/254_200.jpg','http://www.3366.com/heji/186_new.shtml','0');");
E_D("replace into `phome_enewstags` values('255','唯美','weimei','1','1','0','唯美，顾名思义，就是那种特别美的东西，一些很美的画面也包括在内。在小游戏的世界里，唯美值的是画面很美的小游戏。小编很喜欢唯美风的小游戏哦！还特别为您整理了这样一个合集，来3366体验一下吧！','/d/img/tag/255_80.jpg','/d/img/tag/255_200.jpg','http://www.3366.com/heji/127_new.shtml','0');");
E_D("replace into `phome_enewstags` values('256','兔子','tuzi','7','1','0','温顺可爱的兔子成了小游戏最受欢迎的角色，它们随时适合卖萌，有需要的时候还可以随时装白痴。遇到胡萝卜的时候，就连猎豹也无法追赶上它。3366兔子合集，把所有以兔子为主角的游戏一网打尽，一起来Happy吧！','/d/img/tag/256_80.jpg','/d/img/tag/256_200.jpg','http://www.3366.com/heji/136_new.shtml','0');");
E_D("replace into `phome_enewstags` values('257','大炮','dapao','3','1','0','大炮是大家所熟知的重型攻击武器，其威力不容小视。正因为其摧毁威力大，破坏性强，所有很多游戏中都有大炮的出现，射击游戏不在话下，而很多物理游戏中大炮的出现也让游戏更加有趣，3366大炮小游戏合集，让你操控重型武器，领略破坏的快感！','/d/img/tag/257_80.jpg','/d/img/tag/257_200.jpg','http://www.3366.com/heji/149_new.shtml','0');");
E_D("replace into `phome_enewstags` values('258','密室逃脱','mishitaotuo','27','0','2',NULL,NULL,NULL,'http://www.3366.com/games/39-375_new_pic.shtml','0');");
E_D("replace into `phome_enewstags` values('259','解体','jieti','1','0','0','解体小游戏是由日本小游戏制作者创作的flips系列小游戏，玩法是需要玩家将特定的物品拆成一块一块，最后解除安装在物品内的危险物。独具匠心的游戏设计和精美的游戏画面，获得广大解谜爱好者的喜爱。3366解体小游戏合集将全套解体游戏奉献给大家，喜欢考验自己动手能力的你可千万不要错过哦！','/d/img/tag/259_80.jpg','/d/img/tag/259_200.jpg','http://www.3366.com/heji/228_new.shtml','0');");
E_D("replace into `phome_enewstags` values('260','接东西','jiedongxi','2','0','0','天上也会掉馅饼！？是的，可是掉了你就一定能接住么？机会永远只会垂青于有准备的人。赶紧练习接馅饼吧，但是要小心，天上掉的，可不一定都是馅饼，还有可能是陷阱。3366接东西专题收录国内外接东西类小游戏，让你感受天上掉馅饼的喜悦。','/d/img/tag/260_80.jpg','/d/img/tag/260_200.jpg','http://www.3366.com/heji/65_new.shtml','0');");
E_D("replace into `phome_enewstags` values('261','物理','wuli','29','0','0','重力、角度、力量、加速度，利用你知道的一切物理知识，去挑战这些看似不可能完成的任务吧！牛顿、伽利略、爱因斯坦在这一刻灵魂附体，你不是一个人在战斗！3366物理平衡类专题收录国内外物理平衡类小游戏，给你最真实的物理小游戏体验！','/d/img/tag/261_80.jpg','/d/img/tag/261_200.jpg','http://www.3366.com/heji/58_new.shtml','0');");
