E_D("replace into `phome_enewstags` values('263','万能阿曼','wannengaman','1','0','0','《万能阿曼》是由Disney公司制作并推出的风靡欧美的著名卡通动画片――Hanndy Manny，万能阿曼是页岩山的修理师傅，经营一家修理店 。他的爱好是帮助别人。他有八个不同的工具，阿曼和它们一起完成各种工作。3366万能阿曼小游戏让你成为最有爱的修理工，帮助游戏里的人物将所有机械问题一一解决。','/d/img/tag/263_80.jpg','/d/img/tag/263_200.jpg','http://www.3366.com/heji/239_new.shtml','0');");
