E_D("replace into `phome_enewstags` values('265','恐怖','kongbu','1','0','0','明知山有虎，偏向虎山行！这里的游戏惊悚，刺激，吓人。可是对于有些人来说，越是恐怖，越是吓人就越是要玩！这可是勇敢者的游戏。3366胆颤心惊专题收录国内外胆颤心惊类小游戏，哪怕是再恐怖的场景，也一样要被你征服！','/d/img/tag/265_80.jpg','/d/img/tag/265_200.jpg','http://www.3366.com/heji/68_new.shtml','0');");
