E_D("replace into `phome_enewstags` values('267','万圣节','wanshengjie','2','0','0','万圣节在国外也是个十分隆重的节日，不过近几年来，这个节日也逐渐变为了一种狂欢，包括南瓜也慢慢的成为一种可以用来搞怪的物品。关于万圣节的小游戏大都比较可爱，3366的小编特别收集了一批这方面的典型小游戏，来尝试一下吧！','/d/img/tag/267_80.jpg','/d/img/tag/267_200.jpg','http://www.3366.com/heji/118_new.shtml','0');");
