E_D("replace into `phome_enewstags` values('269','外星人','waixingren','3','0','0','在地球以外的浩海星空里有着太多的神秘地带了！那些神秘地带也许生活着我们所不能了解的外星人，他们也许和我们一样，也许和我们完全不一样，想知道外星人在小游戏中的模样吗？来3366体验吧！','/d/img/tag/269_80.jpg','/d/img/tag/269_200.jpg','http://www.3366.com/heji/84_new.shtml','0');");
E_D("replace into `phome_enewstags` values('270','三国','sanguo','1','0','0','三国时期是中国历史上一个风起云涌的时代，从汉末乱世到三国鼎立，再从三国鼎立到晋国一统，无数的英雄豪杰们都在这个时期为了各自的理想出谋划策、血染杀场。以三国为题材的游戏也从来都是永恒的焦点。让我们从Flash小游戏这个简单而不单调的角度来细细品读三国的滋味。','/d/img/tag/270_80.jpg','/d/img/tag/270_200.jpg','http://www.3366.com/heji/28_new.shtml','0');");
E_D("replace into `phome_enewstags` values('271','超难','chaonan','4','0','0','本专题仅供逻辑推理能力或空间想象能力或辨识记忆能力或手脚协调能力超常的非一般人士挑战！够牛你就来！','/d/img/tag/271_80.jpg','/d/img/tag/271_200.jpg','http://www.3366.com/heji/67_new.shtml','0');");
E_D("replace into `phome_enewstags` values('272','彩色画笔','caisehuabi','1','1','0','整个世界最初是没有颜色的，自从有了爱，世界就变成七彩的了。放飞你的想象力，用你的画笔和你的心，给这个世界涂满颜色吧。睁开眼，看看这个美丽的世界。3366涂鸦填色专题收录国内外涂鸦填色类小游戏，世界在你手中被创造。','/d/img/tag/272_80.jpg','/d/img/tag/272_200.jpg','http://www.3366.com/heji/56_new.shtml','0');");
E_D("replace into `phome_enewstags` values('273','索尼克','suonike','1','1','0','索尼克可是世界上最出名的刺猬，作为一只刺猬，它具有无以伦比的奔跑速度，什么样的赛道都挡不住他呢！想要玩最完整的索尼克全集吗？来3366寻找吧，带领索尼克去各种疯狂的赛事现场驰骋吧！','/d/img/tag/273_80.jpg','/d/img/tag/273_200.jpg','http://www.3366.com/heji/72_new.shtml','0');");
E_D("replace into `phome_enewstags` values('274','关卡全开版','guankaquankaiban','1','1','0','最喜欢玩的就是关卡全开版了！在这一类的游戏里，你可以选择你想玩的关卡，不必受关卡的局限，也不必因为没过某一关而不能完成整个游戏。3366收集了众多关卡全开版的小游戏，就等你来挑战！','/d/img/tag/274_80.jpg','/d/img/tag/274_200.jpg','http://www.3366.com/heji/133_new.shtml','0');");
E_D("replace into `phome_enewstags` values('275','射箭','shejian','1','0','0','弓是古时候的战争兵器之一，现在射箭已经成为的一项体育比赛项目。要击中远方的靶要考虑许多因素，风力，重力的影响都会导致落点的偏离。让我们一起来3366体验这种非常具有挑战性的运动吧。','/d/img/tag/275_80.jpg','/d/img/tag/275_200.jpg','http://www.3366.com/heji/222_new.shtml','0');");
E_D("replace into `phome_enewstags` values('276','飞哥与小佛','feigeyuxiaofo','1','0','0','飞哥和他同母异父的弟弟小佛是充满无限想象力和行动能力的最佳拍档，随着暑假的来临，他们已经准备好要大展身手！飞哥与小佛每天都能够创造出奇迹似的酷玩意儿，像是在后院造云霄飞车、盖大峡谷，甚至发明复制机械人。但拥有无比想象力的飞哥发仔却有个告密派的姐姐：凯蒂丝！凯蒂丝总是想要向妈妈证明弟弟们每天都在做惊人的事情，但往往因为各种巧合无法成功……3366飞哥与小佛小游戏合集让你帮助他们兄弟实现梦想。','/d/img/tag/276_80.jpg','/d/img/tag/276_200.jpg','http://www.3366.com/heji/240_new.shtml','0');");
